import axios from 'axios'

/*
* 发送请求获取成绩数据*/
export default function request(studentID, studentPassword){
  var params=new URLSearchParams();
  params.append(("Sid",studentID));
  params.append(("Pwd",studentPassword));
  axios.post('localhost:1323/test',params).then(function (response) {
        return({
          studentDataResult: response,
        });
      })
      .catch(function (error) {
        console.log(error);
      });
};
